import logo from './logo.svg';
import './App.css';
import ListItem from './components/ListItem/ListItem'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <div class="list">
          <ListItem text="做作业" />
          <ListItem text="考试" />
          <ListItem text="毕业" />
        </div>
      </header>
    </div>
  );
}

export default App;
